import React from "react";
import Card from "./Card";
import {Colordata} from './Colordata'


console.log(Colordata)
const App = () => {
    return(
        <>
            {Colordata.map( (val) => {
               return <Card 
               key={val.id}
               color={val.color}
               name={val.name} 
               />
        })}
        </>
    )
}

export default App;
